import React from 'react';
import './index.css';
import { useState } from 'react';
import "@material-ui/core"

function HomePage() {
  const [sessionNumber, setSessionNumber] = useState(4);
  const [workTime, setWorkTime] = useState(25);
  const [breakTime, setBreakTime] = useState(25);

  return (
    <div className="App">
      <div className="App-header">
        <p>Pomodoro Timer</p>
        <div className="even-columns">
            <div className="col">Sessions</div>
            <div className="col">Work Time</div>
            <div className="col">Break Time</div>
        </div>
        <div className="even-columns">
            <div className="col">
              <button className="button">
                <i className="material-icons">arrow_downward</i>
              </button>
               {sessionNumber} 
              </div>
            <div className="col">{workTime}</div>
            <div className="col">{breakTime}</div>
        </div>
      </div>
    </div>
  );
}

export default HomePage;
